import React, { useEffect, useState } from 'react';
import { useParams, useNavigate, Link } from 'react-router-dom';
import api from '../services/api';

export default function PetDetails() {
  const { id } = useParams();
  const navigate = useNavigate();
  const [pet, setPet] = useState(null);
  const [eventos, setEventos] = useState([]);

  useEffect(() => {
    api.get(`/api/pets/${id}`)
      .then((res) => setPet(res.data))
      .catch((err) => {
        console.error('Erro ao buscar pet:', err);
        navigate('/pets');
      });

    api.get(`/api/eventos/pet/${id}`)
      .then((res) => setEventos(res.data))
      .catch((err) => console.error('Erro ao buscar eventos:', err));
  }, [id, navigate]);

  const handleDelete = () => {
    if (window.confirm('Tem certeza que deseja excluir este pet?')) {
      api.delete(`/api/pets/${id}`)
        .then(() => navigate('/pets'))
        .catch((err) => console.error('Erro ao excluir pet:', err));
    }
  };

  if (!pet) return <p>Carregando...</p>;

  return (
    <div className="container">
      <h2 className="mb-4">Detalhes do Pet</h2>
      <ul className="list-group">
        <li className="list-group-item"><strong>Nome:</strong> {pet.nome}</li>
        <li className="list-group-item"><strong>Raça:</strong> {pet.raca}</li>
        <li className="list-group-item"><strong>Peso:</strong> {pet.peso} kg</li>
        <li className="list-group-item"><strong>Porte:</strong> {pet.porte}</li>
        <li className="list-group-item"><strong>Sexo:</strong> {pet.sexo}</li>
        <li className="list-group-item"><strong>Cor:</strong> {pet.cor}</li>
        <li className="list-group-item"><strong>Carteira de Vacinação em Dia:</strong> {pet.vacinado ? 'Sim' : 'Não'}</li>
        <li className="list-group-item"><strong>Castrado:</strong> {pet.castrado ? 'Sim' : 'Não'}</li>
        <li className="list-group-item"><strong>Data de Cadastro:</strong> {new Date(pet.dataCadastro).toLocaleDateString()}</li>
      </ul>

      <div className="d-flex gap-2 mt-4">
        <Link to={`/pets/${id}/editar`} className="btn btn-outline-primary">Editar</Link>
        <button onClick={handleDelete} className="btn btn-outline-danger">Excluir</button>
        <Link to="/pets" className="btn btn-secondary">Voltar à Lista</Link>
        <Link to={`/pets/${id}/novo-evento`} className="btn btn-success">Cadastrar Evento</Link>
      </div>

      <hr className="my-4" />
      <h4>Eventos relacionados</h4>
      {eventos.length === 0 ? (
        <p>Nenhum evento registrado para este pet.</p>
      ) : (
        <ul className="list-group">
          {eventos.map((evento) => (
            <li key={evento._id} className="list-group-item">
              <strong>{evento.tipo}</strong> - Check-in: {new Date(evento.dataEntrada).toLocaleDateString()} - Check-out: {evento.dataSaida ? new Date(evento.dataSaida).toLocaleDateString() : 'em andamento'}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}
